  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. The Feature Names Relationship File (FEATNAMES.dbf) contains a record for
  each feature name andn               any attributes associated with it. Each feature
  name can be linked to the corresponding edges that make up that feature in the All
  Lines Shapefilen               (EDGES.shp), where applicable to the corresponding
  address range or ranges in the Address Ranges Relationship File (ADDR.dbf), or to
  both files.n               Although this file includes feature names for all linear
  features, not just road features, the primary purpose of this relationship file
  is to identifyn               all street names associated with each address range.
  An edge can have several feature names; an address range located on an edge can
  be associated withn               one or any combination of the available feature
  names (an address range can be linked to multiple feature names). The address range
  is identified by then               address range identifier (ARID) attribute, which
  can be used to link to the Address Ranges Relationship File (ADDR.dbf). The linear
  feature is identifiedn               by the linear feature identifier (LINEARID)
  attribute, which can be used to relate the address range back to the name attributes
  of the feature in then               Feature Names Relationship File or to the feature
  record in the Primary Roads, Primary and Secondary Roads, or All Roads Shapefiles.
  The edge to which an               feature name applies can be determined by linking
  the feature name record to the All Lines Shapefile (EDGES.shp) using the permanent
  edge identifiern               (TLID) attribute. The address range identifier(s)
  (ARID) for a specific linear feature can be found by using the linear feature identifier
  (LINEARID)n               from the Feature Names Relationship File (FEATNAMES.dbf)
  through the Address Range / Feature Name Relationship File (ADDRFN.dbf).\",\n\t\"license_title\":
